import App from "./App";
import Start from "./Start";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

function Home() {
  return (
    <Router>
      <Switch>
        <Route path="/Start">
          <Start />
        </Route>

        {/* <Route path="/App">
          <App />
        </Route> */}
      </Switch>
    </Router>
  );
}

export default Home;
